(2533, 1.636540923634127e18, 'Sementara, rangkaian kegiatan perayaan Hari Raya Nyepi tahun Saka 1945 di Candi Prambanan dimulai dengan Upacara Tawur Kesanga pada 21 Maret 2023. Setelah itu, juga diadakan Kirab Pawai Ogoh-Ogoh dan Pangrupukan yang bisa dilihat oleh wisatawan. https://t.co/5UAiFyG64z', 'Sementara, rangkaian kegiatan perayaan Hari Raya Nyepi tahun Saka 1945 di Candi Prambanan dimulai dengan Upacara Tawur Kesanga pada 21 Maret 2023. Setelah itu, juga diadakan Kirab Pawai Ogoh-Ogoh dan Pangrupukan yang bisa dilihat oleh wisatawan. ', 'sementara rangkai giat raya hari raya nyepi tahun saka 1945 di candi prambanan mulai dengan upacara tawur sanga pada 21 maret 2023 telah itu juga ada kirab pawai ogoh-ogoh dan pangrupukan yang bisa lihat oleh wisatawan', 'positif', '2023-03-17 19:33:05', 'Candi Prambanan'),
