(2643, 1.641276968955167e18, 'Bhante Panyavaro berpesan untuk memberi kemudahan akses beribadah umat Buddha di Candi Borobudur. Hal ini komitmen PT TWC sesuai Nota Kesepahaman Pemanfaatan Candi Prambanan dan Candi Borobudur untuk Kepentingan Agama Umat Hindu dan Umat Buddha di Indonesia dan dunia.', 'Bhante Panyavaro berpesan untuk memberi kemudahan akses beribadah umat Buddha di Candi Borobudur. Hal ini komitmen PT TWC sesuai Nota Kesepahaman Pemanfaatan Candi Prambanan dan Candi Borobudur untuk Kepentingan Agama Umat Hindu dan Umat Buddha di Indonesia dan dunia.', 'bhante panyavaro pesan untuk beri mudah akses ibadah umat buddha di candi borobudur hal ini komitmen pt twc sesuai nota paham manfaat candi prambanan dan candi borobudur untuk penting agama umat hindu dan umat buddha di indonesia dan dunia', 'positif', '2023-03-30 11:44:24', 'Candi Prambanan'),
(2644, 1.641276047252681e18, 'Direksi PT Aviasi Pariwisata Indonesia (Persero) atau InJourney melakukan kunjungan kerja ke sejumlah destinasi yang dikelola oleh PT TWC di DI Yogyakarta dan Jawa Tengah. Kunjungan ini dihadiri juga oleh seluruh direksi PT Taman Wisata Candi Borobudur, Prambanan dan Ratu Boko. https://t.co/IaYpUTKjnY', 'Direksi PT Aviasi Pariwisata Indonesia (Persero) atau InJourney melakukan kunjungan kerja ke sejumlah destinasi yang dikelola oleh PT TWC di DI Yogyakarta dan Jawa Tengah. Kunjungan ini dihadiri juga oleh seluruh direksi PT Taman Wisata Candi Borobudur, Prambanan dan Ratu Boko. ', 'direksi pt aviasi pariwisata indonesia persero atau injourney laku kunjung kerja ke jumlah destinasi yang kelola oleh pt twc di di yogyakarta dan jawa tengah kunjung ini hadir juga oleh seluruh direksi pt taman wisata candi borobudur prambanan dan ratu boko', 'positif', '2023-03-30 11:44:24', 'Candi Prambanan'),
