(2878, 1.640517127026381e18, 'Ketika kita melewati rel kereta api stasiun Tugu, melihat kendaraan bermotor melewati rel itu yg mestinya dilarang, lalu Adekku bilang, lalu lintas Yogyakarta semakin semrawut. Orang²-nya byk yg gak tertib lalu lintas. Jalan satu arah pd dua arah. Dan @polresjogja gak menindak.', 'Ketika kita melewati rel kereta api stasiun Tugu, melihat kendaraan bermotor melewati rel itu yg mestinya dilarang, lalu Adekku bilang, lalu lintas Yogyakarta semakin semrawut. Orang²-nya byk yg gak tertib lalu lintas. Jalan satu arah pd dua arah. Dan gak menindak.', 'ketika kita lewat rel kereta api stasiun tugu lihat kendara motor lewat rel itu yg mesti larang lalu adekku bilang lalu lintas yogyakarta makin semrawut orang -nya byk yg gak tertib lalu lintas jalan satu arah pd dua arah dan gak tindak', 'negatif', '2023-03-30 12:09:39', 'Tugu Yogyakarta'),
