(3942, 1.644527562369147e18, '4.  Pada hari Sabtu tanggal 8 April 2023 Piket Intelkam Polsek Kraton rencananya akan bertemu dengan pihak Penghageng Kawedanan Panitrapura Keraton Yogyakarta untuk melaksanakan koordinasi lebih lanjut terkait informasi kegiatan pengobatan Ibu Ida Dayak tersebut.\ncc @Upil_Jaran2', '4.  Pada hari Sabtu tanggal 8 April 2023 Piket Intelkam Polsek Kraton rencananya akan bertemu dengan pihak Penghageng Kawedanan Panitrapura Keraton Yogyakarta untuk melaksanakan koordinasi lebih lanjut terkait informasi kegiatan pengobatan Ibu Ida Dayak tersebut.\ncc', '4 pada hari sabtu tanggal 8 april 2023 piket intelkam polsek kraton rencana akan temu dengan pihak penghageng kawedanan panitrapura keraton yogyakarta untuk laksana koordinasi lebih lanjut kait informasi giat obat ibu ida dayak sebut cc', 'netral', '2023-04-08 12:12:52', 'Kraton Yogyakarta'),
(3943, 1.6445275579945e18, 'Penghageng Kawedanan Panitrapura Keraton Yogyakarta.\n2. Pada hari Jum\'at tanggal 7 April 2023 kantor Panghageng Panitrapura Keraton tutup  karena hari libur.\n3. Sampai saat ini belum ada pemberitahun / permintaan ijin dari panitia giat tersebut ke Polsek Kraton.', 'Penghageng Kawedanan Panitrapura Keraton Yogyakarta.\n2. Pada hari Jum\'at tanggal 7 April 2023 kantor Panghageng Panitrapura Keraton tutup  karena hari libur.\n3. Sampai saat ini belum ada pemberitahun / permintaan ijin dari panitia giat tersebut ke Polsek Kraton.', 'penghageng kawedanan panitrapura keraton yogyakarta 2 pada hari jum at tanggal 7 april 2023 kantor panghageng panitrapura keraton tutup karena hari libur 3 sampai saat ini belum ada pemberitahun minta ijin dari panitia giat sebut ke polsek kraton', 'netral', '2023-04-08 12:12:52', 'Kraton Yogyakarta'),
(3944, 1.64452755068801e18, 'Wib bertempat di Keraton Yogyakarta Piket Unit Intelkam Polsek Kraton Polresta Yogyakarta melaksanakan Pulbaket menindaklanjuti informasi yang beredar di media sosial  tentang rencana kegiatan Pengobatan Tradisional Ibu Ida Dayak di Alun - alun Selatan Kraton Yogyakarta.', 'Wib bertempat di Keraton Yogyakarta Piket Unit Intelkam Polsek Kraton Polresta Yogyakarta melaksanakan Pulbaket menindaklanjuti informasi yang beredar di media sosial  tentang rencana kegiatan Pengobatan Tradisional Ibu Ida Dayak di Alun - alun Selatan Kraton Yogyakarta.', 'wib tempat di keraton yogyakarta piket unit intelkam polsek kraton polresta yogyakarta laksana pulbaket menindaklanjuti informasi yang edar di media sosial tentang rencana giat obat tradisional ibu ida dayak di alun - alun selatan kraton yogyakarta', 'netral', '2023-04-08 12:12:52', 'Kraton Yogyakarta'),
(3945, 1.644527548263707e18, 'Kepada : Yth. KAPOLRESTA YOGYAKARTA\nDari       : KAPOLSEK KRATON\n\nPerihal : Pulbaket Informasi Rencana Pengobatan Ibu Ida Dayak Di Alun alun Selatan Kraton.\n\nAssallamu\'allaikum Wr. Wb.\nSelamat sore Komandan, mohon ijin melaporkan pada hari Jum\'at tanggal 7 April 2023 pukul 15.30. https://t.co/jVrLuHqbmS', 'Kepada : Yth. KAPOLRESTA YOGYAKAA\nDari       : KAPOLSEK KRATON\n\nPerihal : Pulbaket Informasi Rencana Pengobatan Ibu Ida Dayak Di Alun alun Selatan Kraton.\n\nAssallamu\'allaikum Wr. Wb.\nSelamat sore Komandan, mohon ijin melaporkan pada hari Jum\'at tanggal 7 April 2023 pukul  ', 'kepada yth kapolresta yogyakaa dari kapolsek kraton perihal pulbaket informasi rencana obat ibu ida dayak di alun alun selatan kraton assallamu allaikum wr wb selamat sore komandan mohon ijin lapor pada hari jum at tanggal 7 april 2023 pukul', 'netral', '2023-04-08 12:12:52', 'Kraton Yogyakarta'),
(3946, 1.644349909452354e18, 'Dikutip dari @majalahSM,  sebagai penghulu Kraton dan Ketua Majelis Tarjih Muhammadiyah, KH KRT Muhammad Wardan Diponingrat memiliki posisi yang sangat sentral dalam upacara keagamaan di Yogyakarta kala itu.\nhttps://t.co/d9knTzb4IF', 'Dikutip dari  sebagai penghulu Kraton dan Ketua Majelis Tarjih Muhammadiyah, KH K Muhammad Wardan Diponingrat memiliki posisi yang sangat sentral dalam upacara keagamaan di Yogyakarta kala itu.\n', 'kutip dari bagai penghulu kraton dan ketua majelis tarjih muhammadiyah kh k muhammad wardan diponingrat milik posisi yang sangat sentral dalam upacara agama di yogyakarta kala itu', 'netral', '2023-04-08 12:12:52', 'Kraton Yogyakarta'),
