(4086, 1.645213438497673e18, 'Pelaksanaan KRYD gabungan jajaran Polsek rayon 2 (dua) bertempat di depan pasar Ngasem wilayah kraton Yogyakarta yang dipimpin oleh piket pawas Polsek Kraton AKP Aris Harjito, Senin (10/04/2023). \n#polsekmantrijeron\n#patrolijogja\nhttps://t.co/CnWefEN2eH https://t.co/hBJ2zK7r85', 'Pelaksanaan KRYD gabungan jajaran Polsek rayon 2 (dua) bertempat di depan pasar Ngasem wilayah kraton Yogyakarta yang dipimpin oleh piket pawas Polsek Kraton AKP Aris Harjito, Senin (10/04/2023). \n ', 'laksana kryd gabung jajar polsek rayon 2 dua tempat di depan pasar ngasem wilayah kraton yogyakarta yang pimpin oleh piket pawas polsek kraton akp aris harjito senin 10 04 2023', 'netral', '2023-04-10 13:51:05', 'Kraton Yogyakarta'),
(4087, 1.645207126477001e18, 'Kegiatan Razia dalam Rangka KRYD gabungan Polsek  Rayon 2  di Depan Pasar Ngasem Kraton Jln Polowijan Kraton Yogyakarta \nMelaksanakan pemeriksaan dengan sasaran Sajam ,Narkoba ,Knalpot Blombongan  dan miras antisipasi kejahatan jalanan dan lainya. 10/4/2023. https://t.co/d7Sf06cCSb', 'Kegiatan Razia dalam Rangka KRYD gabungan Polsek  Rayon 2  di Depan Pasar Ngasem Kraton Jln Polowijan Kraton Yogyakarta \nMelaksanakan pemeriksaan dengan sasaran Sajam ,Narkoba ,Knalpot Blombongan  dan miras antisipasi kejahatan jalanan dan lainya. 10/4/2023. ', 'giat razia dalam rangka kryd gabung polsek rayon 2 di depan pasar ngasem kraton jln polowijan kraton yogyakarta laksana periksa dengan sasar sajam narkoba knalpot blombongan dan miras antisipasi jahat jalan dan lai 10 4 2023', 'negatif', '2023-04-10 13:51:05', 'Kraton Yogyakarta'),
(4088, 1.64519961615208e18, 'Apel kryd ( kegiatan rutin yang ditingkatkan rayon 2 disekitar pasar Ngasem Yogyakarta dilanjutkan razia dipimpin AKP Aris Harjito sebagai tuan rumah Polsek kraton.\n\n10/4/2023 https://t.co/DAPDY5BLaZ', 'Apel kryd ( kegiatan rutin yang ditingkatkan rayon 2 disekitar pasar Ngasem Yogyakarta dilanjutkan razia dipimpin AKP Aris Harjito sebagai tuan rumah Polsek kraton.\n\n10/4/2023 ', 'apel kryd giat rutin yang tingkat rayon 2 sekitar pasar ngasem yogyakarta lanjut razia pimpin akp aris harjito bagai tuan rumah polsek kraton 10 4 2023', 'netral', '2023-04-10 13:51:05', 'Kraton Yogyakarta'),
(4089, 1.645180332445147e18, 'Apel KRYD (kegiatan rutin yang ditingkatkan) gabungan Rayon 2 dipimpin oleh AKP ARIS HARJITO    ( Kanit Bimas Kraton)  personil gabungan dari perwakilan Polssek Sepolresta yogyakarta  dilanjutkan Razia kendaraan di depan Pasar Ngasem Kraton, Senin, 10/4/2023.#patrolijogja https://t.co/9Jk20GW4Nn', 'Apel KRYD (kegiatan rutin yang ditingkatkan) gabungan Rayon 2 dipimpin oleh AKP ARIS HARJITO    ( Kanit Bimas Kraton)  personil gabungan dari perwakilan Polssek Sepolresta yogyakarta  dilanjutkan Razia kendaraan di depan Pasar Ngasem Kraton, Senin, 10/4', 'apel kryd giat rutin yang tingkat gabung rayon 2 pimpin oleh akp aris harjito kanit bimas kraton personil gabung dari wakil polssek sepolresta yogyakarta lanjut razia kendara di depan pasar ngasem kraton senin 10 4', 'netral', '2023-04-10 13:51:05', 'Kraton Yogyakarta'),
(4090, 1.645118026252165e18, 'RT @bukupembaharu: Muhammadiyah merupakan bagian dari empat pilar utama keistimewaan DIY. \n\nTerimakasih tambahannya mas @AdhiIsak \n\nHal ter…', ' Muhammadiyah merupakan bagian dari empat pilar utama keistimewaan DIY. \n\nTerimakasih tambahannya mas \n\nHal ter…', 'muhammadiyah rupa bagi dari empat pilar utama istimewa diy terimakasih tambah mas hal ter', 'positif', '2023-04-10 13:51:05', 'Kraton Yogyakarta'),
(4091, 1.645098385370923e18, 'Muhammadiyah merupakan bagian dari empat pilar utama keistimewaan DIY. \n\nTerimakasih tambahannya mas @AdhiIsak \n\nHal tersebut disampaikan Gubernur DIY Sri Sultan Hamengku Buwono X dalam Milad @Muhammadiyah ke-105 pada tahun 2017 di Kraton Yogyakarta. \nhttps://t.co/mOqvb0Y0hE', 'Muhammadiyah merupakan bagian dari empat pilar utama keistimewaan DIY. \n\nTerimakasih tambahannya mas \n\nHal tersebut disampaikan Gubernur DIY Sri Sultan Hamengku Buwono X dalam Milad ke-105 pada tahun 2017 di Kraton Yogyakarta. \n', 'muhammadiyah rupa bagi dari empat pilar utama istimewa diy terimakasih tambah mas hal sebut sampai gubernur diy sri sultan hamengku buwono x dalam milad ke-105 pada tahun 2017 di kraton yogyakarta', 'positif', '2023-04-10 13:51:05', 'Kraton Yogyakarta'),
(4092, 1.644962525157691e18, '@gasspontan @PIN_Independen Makane ta. Nek duduk wong sing ngrasakno urip nang Yogyakarta mbok ngerti. Yogyakarta wes ora kayak jaman Majapahit sing sepi ngono. Wes setara ibukota provinsi, kota pelajar, lan kota hari tua. Makane Yogya akeh diincer, nggarakno tanahe wes larang.\nTerus, apa kebijakane Kraton?', ' Makane ta. Nek duduk wong sing ngrasakno urip nang Yogyakarta mbok ngerti. Yogyakarta wes ora kayak jaman Majapahit sing sepi ngono. Wes setara ibukota provinsi, kota pelajar, lan kota hari tua. Makane Yogya akeh diincer, nggarakno tanahe wes larang.\nTerus, apa kebijakane Kraton?', 'makane ta nek duduk wong sing ngrasakno urip nang yogyakarta mbok ngerti yogyakarta wes ora kayak jaman majapahit sing sepi ngono wes tara ibukota provinsi kota ajar lan kota hari tua makane yogya akeh diincer nggarakno tanahe wes larang terus apa kebijakane kraton', 'netral', '2023-04-10 13:51:05', 'Kraton Yogyakarta'),
