(4668, 1.646095359150817e18, '6. Candi Prambanan\n\nSisi timur Daerah Istimewa Yogyakarta tidak pernah membosankan: terutama bagi pecinta wisata budaya dan sejarah. Candi Prambanan, candi peninggalan Hindu, berdiri kokoh menjadi salah satu atraksi wisata yang tidak boleh dilewatkan bila berkunjung ke Yogyakarta', '6. Candi Prambanan\n\nSisi timur Daerah Istimewa Yogyakarta tidak pernah membosankan: terutama bagi pecinta wisata budaya dan sejarah. Candi Prambanan, candi peninggalan Hindu, berdiri kokoh menjadi salah satu atraksi wisata yang tidak boleh dilewatkan bila berkunjung ke Yogyakarta', '6 candi prambanan sisi timur daerah istimewa yogyakarta tidak pernah bosan utama bagi cinta wisata budaya dan sejarah candi prambanan candi tinggal hindu diri kokoh jadi salah satu atraksi wisata yang tidak boleh lewat bila kunjung ke yogyakarta', 'negatif', '2023-04-14 09:48:38', 'Candi Prambanan'),
