(4853, 1.645512061286498e18, 'Di Museum Ganesya Malang terdapat arca harimau siluman yang dikenal dengan nama Nyai Giri Kencono. Menurut mitos, siluman tersebut merupakan penghuni beringin yang dulu berada di stasiun Tugu, Yogyakarta. Pada tahun 1885 pohon tsb ditebang utk pembangunan stasiun. https://t.co/09bYw6NxHF https://t.co/JR7XRm4qex', 'Di Museum Ganesya Malang terdapat arca harimau siluman yang dikenal dengan nama Nyai Giri Kencono. Menurut mitos, siluman tersebut merupakan penghuni beringin yang dulu berada di stasiun Tugu, Yogyakarta. Pada tahun 1885 pohon tsb ditebang utk pembangunan stasiun.  ', 'di museum ganesya malang dapat arca harimau siluman yang kenal dengan nama nyai giri kencono turut mitos siluman sebut rupa huni beringin yang dulu ada di stasiun tugu yogyakarta pada tahun 1885 pohon tsb tebang utk bangun stasiun', 'negatif', '2023-04-14 09:48:52', 'Tugu Yogyakarta'),
