(4877, 1.647801943769895e18, '“Petugas di depan briefing-nya bagus. Kalau kayak Borobudur kan relatif sistemnya settle, bagus. Termasuk SDM-nya, aturannya. Mudah-mudahan nanti tempat wisata yang lain juga menyesuaikan,” ucapnya.', '“Petugas di depan briefing-nya bagus. Kalau kayak Borobudur kan relatif sistemnya settle, bagus. Termasuk SDM-nya, aturannya. Mudah-mudahan nanti tempat wisata yang lain juga menyesuaikan,” ucapnya.', 'tugas di depan briefing-nya bagus kalau kayak borobudur kan relatif sistem settle bagus masuk sdm-nya atur mudah nanti tempat wisata yang lain juga sesuai ucap', 'positif', '2023-04-17 10:56:18', 'borobudur'),
(4878, 1.64780186461918e18, 'Saat itu, GM Unit Borobudur Jamaludin Mawardi, turut mendampingi Ganjar. Dari hasil pemantauan di candi, Ganjar melihat fasilitas dan petugas di Kawasan Candi Borobudur telah siap menerima wisatawan. Ia berharap hal ini bisa ditiru pengelola wisata lainnya.', 'Saat itu, GM Unit Borobudur Jamaludin Mawardi, turut mendampingi Ganjar. Dari hasil pemantauan di candi, Ganjar melihat fasilitas dan petugas di Kawasan Candi Borobudur telah siap menerima wisatawan. Ia berharap hal ini bisa ditiru pengelola wisata lainnya.', 'saat itu gm unit borobudur jamaludin mawardi turut damping ganjar dari hasil pantau di candi ganjar lihat fasilitas dan tugas di kawasan candi borobudur telah siap terima wisatawan ia harap hal ini bisa tiru kelola wisata lain', 'positif', '2023-04-17 10:56:18', 'borobudur'),
(4879, 1.647801763393855e18, '“Kami memastikan seluruh objek wisata siap untuk menerima para wisatawan, termasuk mungkin kira-kira Borobudur ramainya hari ke tiga lebaran,” kata Ganjar.', '“Kami memastikan seluruh objek wisata siap untuk menerima para wisatawan, termasuk mungkin kira-kira Borobudur ramainya hari ke tiga lebaran,” kata Ganjar.', 'kami pasti seluruh objek wisata siap untuk terima para wisatawan masuk mungkin kira borobudur ramai hari ke tiga lebaran kata ganjar', 'positif', '2023-04-17 10:56:18', 'borobudur');
