(4880, 1.647801675732877e18, 'Ganjar didampingi istrinya, Siti Atikoh, tiba di kawasan Candi Borobudur sekitar pukul 13.00 WIB. Kedatangannya, tidak disambut secara khusus. Ia mengantre bersama wisatawan lainnya, dan membeli tiket khusus kunjungan masuk pelataran candi. Harganya dipatok Rp 50.000 per orang.', 'Ganjar didampingi istrinya, Siti Atikoh, tiba di kawasan Candi Borobudur sekitar pukul  WIB. Kedatangannya, tidak disambut secara khusus. Ia mengantre bersama wisatawan lainnya, dan membeli tiket khusus kunjungan masuk pelataran candi. Harganya dipatok Rp  per orang.', 'ganjar damping istri siti atikoh tiba di kawasan candi borobudur sekitar pukul wib datang tidak sambut cara khusus ia antre sama wisatawan lain dan beli tiket khusus kunjung masuk latar candi harga patok rp per orang', 'positif', '2023-04-17 10:56:18', 'borobudur'),
(4881, 1.647801461047427e18, 'Selain itu, Gubernur Jawa Tengah Ganjar Pranowo melakukan inspeksi mendadak ke Taman Wisata Candi Borobudur, Sabtu (15/4/2023). Candi Borobudur juga menjadi destinasi wisata favorit wisatawan pada saat libur lebaran di Jawa Tengah.', 'Selain itu, Gubernur Jawa Tengah Ganjar Pranowo melakukan inspeksi mendadak ke Taman Wisata Candi Borobudur, Sabtu (15/4/2023). Candi Borobudur juga menjadi destinasi wisata favorit wisatawan pada saat libur lebaran di Jawa Tengah.', 'selain itu gubernur jawa tengah ganjar pranowo laku inspeksi dadak ke taman wisata candi borobudur sabtu 15 4 2023 candi borobudur juga jadi destinasi wisata favorit wisatawan pada saat libur lebaran di jawa tengah', 'positif', '2023-04-17 10:56:18', 'borobudur'),
